    text-transform: uppercase;

    &[disabled] {
        opacity: 1; // override Bootstrap
    }

    &-primary {
        border: none;
        background-color: $vui-color-bg-action-primary;

        &:hover {
            color: currentColor;
            background-color: $vui-color-bg-action-primary-hover;
        }
    }

    &-primary-alt {
        color: $vui-color-neutral-primary-reversed;
        background-color: $vui-color-bg-action-secondary;

        &:hover {
            background-color: $vui-color-bg-action-secondary-hover;
        }

        &.btn-reversed {
            color: $vui-color-bg-action-secondary;
            background-color: $vui-color-bg-ground;

            &:hover {
                color: $vui-color-neutral-primary-reversed;
                background: $vui-color-bg-action-secondary-hover;
            }
        }

    }

    &-primary,
    &-primary-alt,
    &-csr {
        &[disabled],
        &[disabled]:hover {
            color: $vui-color-neutral-tertiary;
            background-color: $vui-color-bg-action-disabled;

            &.btn-reversed {
                color: $vui-color-neutral-secondary;
                background-color: rgba($vui-color-bg-action-disabled-reversed, .5);
            }
        }
    }

    &-secondary {
        color: $vui-color-bg-action-secondary;
        border-color: $vui-color-neutral-secondary;
        background-color: transparent;
        will-change: box-shadow;
        transition: box-shadow .1s ease-in-out;

        &:not([disabled]):hover {
            color: currentColor;
            box-shadow: inset 0 0 0 1px $vui-color-bg-action-secondary-hover;
            border-color: $vui-color-bg-action-secondary-hover;
            background-color: transparent;
        }

        &.btn-reversed {
            color: $vui-color-neutral-primary-reversed;
            border-color: $vui-color-neutral-primary-reversed;

            &:not([disabled]):hover {
                color: $vui-color-neutral-primary-reversed;
                border-color: $vui-color-neutral-primary-reversed;
                box-shadow: inset 0 0 0 1px $vui-color-neutral-primary-reversed;
            }

            &[disabled],
            &[disabled]:hover {
                color: $vui-color-neutral-secondary;
                background-color: transparent;
                border-color: $vui-color-stroke-secondary-reversed;
            }
        }

        &[disabled],
        &[disabled]:hover {
            color: $vui-color-neutral-tertiary;
            background-color: transparent;
            border-color: $vui-color-stroke-secondary;
        }
    }

    &-tertiary {
        border: none;
        background-color: transparent;

        &:hover {
            color: currentColor;
            background-color: $vui-color-bg-action-no-bg-hover;
        }

        &.btn-reversed {
            color: $vui-color-neutral-primary-reversed;

            &:hover {
                background-color: $vui-color-bg-action-disabled-reversed;
            }

            &[disabled],
            &[disabled]:hover {
                color: $vui-color-neutral-secondary;
                background-color: rgba($vui-color-bg-action-disabled-reversed, .5);
            }
        }

        &[disabled],
        &[disabled]:hover {
            color: $vui-color-neutral-tertiary;
            background-color: transparent;
        }
    }

    &-csr {
        color: $vui-color-neutral-primary-reversed;
        border: none;
        background-color: $vui-color-csr;

        &:hover {
            background-color: $vui-color-csr-hover;
        }
    }   
}

